import React, {Component} from "react";
import "../stylesheets/Header.css";

class Header extends Component {
    render () {
        return (
            <div className="header">
                <h1> MAKEOVER FITNESS</h1>
                <div className="menu">
                    <p> Memberships </p>
                    <p> Schedule </p>
                    <p> Calendar </p>
                    <p> Trainers </p>
                </div>
            </div>

        );
    }
}

export default Header;
